   private void setPendingProximityDebounceTime(long debounceTime) {
       if (mPendingProximityDebounceTime < 0) {
           mCallbacks.acquireSuspendBlocker(); // acquire wake lock
       }
       mPendingProximityDebounceTime = debounceTime;
